import { Component } from '@angular/core';
import { Todo } from 'src/models/todo.model';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'OpenERX';
  public todos: Todo[] = [];

  constructor() {
    this.todos.push(new Todo("Programar", true, 1));
    this.todos.push(new Todo("Malhar", true, 2));
    this.todos.push(new Todo("Mercado", false, 3));
    this.todos.push(new Todo("Banho no Cachorro", false, 4));
    this.todos.push(new Todo("Lavar roupa", false, 5));
    this.todos.push(new Todo("Barba", true, 6));
    this.todos.push(new Todo("Cabelo", true, 7));
    this.todos.push(new Todo("Pano na casa", false, 8));
  }
}
